import axios from 'axios'
import React, { Component } from 'react'
import SignUp from '../../../shoppingcart/src/Components/SignUp'

export class LogInOut extends Component {
    constructor(props) {
      super(props)

      this.state = {
         id:""
      }
    }
  render() {

		if (localStorage.getItem("id")) {
            this.setState({id:localStorage.getItem("id")})
			axios.post("http://localhost:8080/logout", this.state)
				.then(response => {
					alert("You are logged out successfully!");
					localStorage.clear();
				})
				.catch(error => {
					alert("Error in logging out");
					console.log(error)
				})
		}
    return (
      <SignUp/>
    )
  }
}

export default LogInOut
